import React from 'react';
import './footerOverlay.css';

const FooterOverlay = () => (
  <div className="react_footerOverlay">
    <div className="react_footerOverlay-black" />
    <div className="react_footerOverlay-img react_bg" />
  </div>
);

export default FooterOverlay;
